import './App.css';
import CoffeeGrid from './components/BeansGrid';
import BeansOfTheDay from './components/BeansOfTheDay';
import Header from "./components/Header";
import { useState } from 'react';

import useAddToOrder from './hooks/useAddToOrder';

function App() {
  const { orderItems, orderCount, addToOrder } = useAddToOrder();

  return (
    <div className="coffee-page">
      <Header orderCount={orderCount} />
      <BeansOfTheDay handleAddToOrder={addToOrder}/>
      <CoffeeGrid handleAddToOrder={addToOrder} />
    </div>
  );
}

export default App;
